window.bookSummaryJSON = "<p>Who is the Inventor, and what does he want with the all-new Ms. Marvel and all her friends? Maybe Wolverine can help!</p> <p>Kamala may be fangirling out when her favorite (okay maybe Top Five) Super Hero shows up, but that won't stop her from protecting her hometown. Then, Kamala crosses paths with Inhumanity for the first time - by meeting the royal dog, Lockjaw!</p> <p>Every girl wants a puppy, but this one may be too much of a handful, even for a Super Hero with embiggening powers. But why is Lockjaw really with Kamala? As Ms. Marvel discovers more about her past, the Inventor continues to threaten her future.</p> <p>GraphicAudio® Production. </p>"; 
